import React from "react";

import Folder from "./Folder";

function Load({ folder }) {
  return (
    <div>
      {folder.map((fold) => {
        if (!fold.isFolder) {
          <div style={{ marginLeft: "20px" }}>{fold.name}</div>;
        } else {
          <Folder folder={fold} />;
        }
      })}
    </div>
  );
}

export default Load;
